# Read the table into a DataFrame
df = spark.table("model_input_tmp0")

# Define a UDF to call ai_query for each row
from pyspark.sql.functions import udf, struct
from pyspark.sql.types import StringType

def get_embedding(celltype_sample, celltype_sample_obs):
    # Replace this with the actual call to ai_query if available in Python
    # For demonstration, return a placeholder
    return ai_query(
        'mmt_scimilarity_get_embedding_v2test',
        request = {
            'celltype_sample': celltype_sample,
            'celltype_sample_obs': celltype_sample_obs
        }
    )

get_embedding_udf = udf(get_embedding, StringType())

# Add the embedding_output column
df_with_embedding = df.withColumn(
    "embedding_output",
    get_embedding_udf(
        df.celltype_sample,
        df.celltype_sample_obs
    )
)

# Overwrite the table with the new DataFrame
df_with_embedding.write.mode("overwrite").saveAsTable("model_input_tmp0")

display(df_with_embedding)

