def extract_batch(input_json):
    import json
    rows = input_json['dataframe_split']['data']
    all_matrices = []
    for row in rows:
        celltype_sample_json = row[0]
        celltype_sample = json.loads(celltype_sample_json)
        matrix = celltype_sample['data'][0][0]
        all_matrices.append(matrix)
    return {"data": all_matrices}

